import axios from "axios";

export const createOrder = (orderData) => {
  return (dispatch) => {
    axios
      .post("/api/orders", orderData)
      .then((response) => {
        dispatch({ type: "CREATE_ORDER_SUCCESS", payload: response.data });
      })
      .catch((error) => {
        dispatch({ type: "CREATE_ORDER_FAILURE", error });
      });
  };
};
